tables.table_schema:
CREATE TABLE feedback_table (
    feedback_id INT PRIMARY KEY,
    customer_id INT,
    feedback_text TEXT,
    rating INT
);

CREATE TABLE review_table (
    review_id INT PRIMARY KEY,
    customer_id INT,
    review_text TEXT,
    review_date DATE
);

CREATE TABLE customers_feedback (
  feedback_id INT PRIMARY KEY,
  customer_id INT NOT NULL,
  feedback_text TEXT NOT NULL,
  feedback_date TIMESTAMP
);

CREATE TABLE services_reviews (
  review_id INT PRIMARY KEY,
  service_id INT NOT NULL,
  review_text TEXT NOT NULL,
  rating FLOAT NOT NULL
);

CREATE TABLE business_decisions (
  decision_id INT PRIMARY KEY,
  decision_date DATE NOT NULL,
  decision_text TEXT NOT NULL
);

CREATE TABLE CustomerFeedback (
    feedback_id INT PRIMARY KEY,
    customer_id INT,
    feedback_text TEXT,
    rating FLOAT
);

CREATE TABLE Review (
    review_id INT PRIMARY KEY,
    customer_id INT,
    review_text TEXT,
    rating FLOAT
);

CREATE TABLE TravelServices (
    service_id INT PRIMARY KEY,
    service_name VARCHAR(255),
    service_category VARCHAR(50),
    service_description TEXT
);

CREATE TABLE BusinessDecisions (
    decision_id INT PRIMARY KEY,
    decision_name VARCHAR(255),
    decision_description TEXT,
    decision_date TIMESTAMP
);

CREATE TABLE customers (
    customer_id INT PRIMARY KEY,
    customer_name TEXT,
    email TEXT,
    phone_number TEXT
);

CREATE TABLE products (
    product_id INT PRIMARY KEY,
    product_name TEXT,
    description TEXT,
    price DECIMAL(10,2)
);

CREATE TABLE employees (
    employee_id INT PRIMARY KEY,
    employee_name TEXT,
    position TEXT,
    hire_date DATE
);
